import React from 'react';

function Introduction(props) {
  return (
    <div>
      <h1>Hi, my name is Noah.</h1>
      <h3>
        I am a UX/UI Designer interested in leveraging technology to make
        people&aposs lives more efficient and happier. I have previously worked
        at Luxrobo, Giant Shoulders, and Weddell Co. to build products from
        scratch. I am currently looking for new opportunities after studying
        Industrial Design at Rhode Island School of Design.
      </h3>
    </div>
  );
}

export default Introduction;
